INSERT INTO `product` (`id`, `category_id`, `name`, `price`, `image`, `description`, `in_stock`) VALUES
(1, 1, 'Macbook m1 pro', '700$', 'AgACAgIAAxkBAAIL1WikoU-Ey47qcH2Ed_FNaR-t6ApQAAL7FzIbUlMpSYhrOtrBotXxAQADAgADeAADNgQ', 'The Apple M1 Pro isa system on a chip (SoC) designed for high-performance laptops, particularly the MacBook Pro. It features a 10-core CPU (with 8 performance cores and 2 efficiency cores), a GPU with up to 16 cores, and a 16-core Neural Engine. The M1 Pro also includes a dedicated media engine with ProRes acceleration for video processing.', 1),
(2, 1, 'Redmi 15 pro', '1200000', 'AgACAgIAAxkBAAIMGGi5cn4TgHM7bMthWgesYCYUEdD4AAKJ_TEbY9vJSc032t1xRXAoAQADAgADeQADNgQ', 'Jdjdjfu', 1),
(3, 1, 'Samsung S24 ultra', '3000000', 'AgACAgIAAxkBAAIMe2jCXLOPqMlaC44Mu-26xBNq-t-MAAJX8DEbGBkRSknb_eyX230ZAQADAgADbQADNgQ', 'The smartphone boasts a super-high-quality 6.8-inch OLED display with a 120Hz refresh rate and 1440p resolution. The screen has been improved with an intelligent tone mapping system that adapts to a wider range of lighting conditions.\n\nThe Snapdragon 8 Gen 2 processor that powers the smartphone should improve battery life. The appearance has also undergone minor changes: the device has received less curved edges for a more comfortable grip.\n\nThe high-resolution camera is a distinctive feature of the S23 Ultra. So, now the most advanced module is not 108, but 200 MP. It can create 200-megapixel or 50-megapixel photos. There is also the ability to take photos at 12 MP - in this mode, the smartphone combines 16 pixels into one, to improve light collection.\n\nSamsung says the main camera\'s optical image stabilization has become more reliable, correcting shake by 3 degrees compared to 1.5 in last year\'s model. The other three rear cameras remain unchanged. The front module is now 12 megapixels, compared to 40 megapixels in the S22 Ultra.', 1);
